import { useParams } from 'react-router-dom'

export function ContactDetail({ updateContact, updateImage }) {
	const [contact, setValues] = useState({
		name: '',
		email: '',
		phone: '',
		address: '',
		title: '',
		status: '',
		photoUrl: '',
	})

	const { id } = useParams()

	return <div>ContactDetail</div>
}
